import React from 'react';
import '../styles/AboutUs.css';

const AboutUs = () => (
  <section className="about-us">
    <h2>About Us</h2>
    <p>
      We find the most beautiful and exclusive Swiss chalets tailored just for you.
      Our mission is to help you discover the perfect alpine escape — whether it’s for a holiday,
      investment, or a luxurious new lifestyle.
    </p>
  </section>
);

export default AboutUs;
